# Author: Le Anh Tuan (latuannetnam@gmail.com) Letcode problem:
# https://leetcode.com/problems/container-with-most-water/ 
# Level: medium 
# You are given an integer array height of length n. There are n vertical lines
# drawn such that the two endpoints of the ith line are (i, 0) and (i,height[i])
# Find two lines that together with the x-axis form a container, such that the
# container contains the most water.
# Return the maximum amount of water a container can store.
# Notice that you may not slant the container.


class Solution:
    def maxArea2(self, height) -> int:
        max_area = 0
        loops = 0
        num_lines = len(height)
        for first_index in range(num_lines-1):
            sub_lines = height[first_index:]
            min_height = min(sub_lines)
            if sub_lines[0] == min_height:
                loops += 1
                area = min_height * (len(sub_lines) - 1)
                if area > max_area:
                        max_area = area
            else:                    
                for second_index in range(first_index+1, num_lines):
                    loops += 1
                    min_height = min(height[first_index], height[second_index])
                    area = min_height*(second_index-first_index)
                    if area > max_area:
                        max_area = area
            print("first index:{}:{} max area:{} loops:{}".format(first_index, height[first_index], max_area, loops))
        print("number of lines:{} loops:{}".format(num_lines, loops))
        return max_area

    # Best solution: https://leetcode.com/problems/container-with-most-water/solution/ 
    def maxArea(self, height) -> int:
        maxarea = 0
        l = 0
        r = len(height) - 1
        loops = 0
        while l < r:
            loops += 1 
            maxarea = max(maxarea, min(height[l], height[r]) * (r - l))
            if height[l] < height[r]:
                l += 1
            else:
                r -= 1
        print("number of lines:{} loops:{}".format(len(height), loops))
        return maxarea

